/*
The Catalog Service provides the ability to query for information about Datasets that are stored in
the Nominal platform. A Dataset is the Nominal representation of data that has been uploaded to Nominal via
a file, primarily CSV.
*/
type CatalogServiceClientWithAuth interface {
	GetEnrichedDataset(ctx context.Context, datasetUuidArg uuid.UUID) (EnrichedDataset, error)
	GetEnrichedDatasets(ctx context.Context, getDatasetsRequestArg GetDatasetsRequest) ([]EnrichedDataset, error)
	GetDataset(ctx context.Context, datasetUuidArg uuid.UUID) (Dataset, error)
	GetDatasets(ctx context.Context, getDatasetsRequestArg GetDatasetsRequest) ([]Dataset, error)
	GetDatasetFile(ctx context.Context, datasetRidArg rid.ResourceIdentifier, fileIdArg datasource.DatasetFileId) (DatasetFile, error)
	GetDatasetFilesForJob(ctx context.Context, ingestJobRidArg rid.ResourceIdentifier, nextPageTokenArg *api.Token) (DatasetFilesPage, error)
	SearchDatasets(ctx context.Context, requestArg SearchDatasetsRequest) (SearchDatasetsResponse, error)
	UpdateDatasetIngestStatusV2(ctx context.Context, detailsArg UpdateIngestStatusV2) (api.IngestStatusV2, error)
	// Deprecated: Deprecated in favor of getDatasetFile.
	GetIngestProgressV2(ctx context.Context, datasetRidArg rid.ResourceIdentifier) (IngestProgressV2, error)
	// Deprecated: Returned in Dataset
	GetHandleForDataset(ctx context.Context, datasetArg uuid.UUID) (*Handle, error)
	CreateDataset(ctx context.Context, detailsArg CreateDataset) (EnrichedDataset, error)
	// Creates a dataset if the s3 path does not exist, otherwise updates the dataset
	CreateOrUpdateDataset(ctx context.Context, detailsArg CreateDataset) (EnrichedDataset, error)
	/*
	   Creates a dataset with a specific UUID. This is useful for migrations and advanced use cases
	   where the dataset UUID must be controlled by the caller. Throws a conflict error if a dataset
	   with the specified UUID already exists. This endpoint is not intended for general use. Use /datasets instead to create a new dataset.
	*/
	CreateDatasetWithUuid(ctx context.Context, requestArg CreateDatasetWithUuidRequest) (EnrichedDataset, error)
	// Adds a single file to an existing dataset.
	AddFileToDataset(ctx context.Context, datasetRidArg rid.ResourceIdentifier, requestArg AddFileToDataset) (DatasetFile, error)
	ListDatasetFiles(ctx context.Context, datasetRidArg rid.ResourceIdentifier, nextPageTokenArg *api.Token) (DatasetFilesPage, error)
	SearchDatasetFiles(ctx context.Context, requestArg SearchDatasetFilesRequest) (SearchDatasetFilesResponse, error)
	GetDatasetFileUri(ctx context.Context, datasetRidArg rids.DatasetRid, fileIdArg datasource.DatasetFileId) (DatasetFileUri, error)
	GetVideoFileUri(ctx context.Context, videoFileRidArg rids.VideoFileRid) (VideoFileUri, error)
	GetOriginFileUris(ctx context.Context, datasetRidArg rids.DatasetRid, fileIdArg datasource.DatasetFileId) ([]OriginFileUri, error)
	MarkFileIngestSuccessful(ctx context.Context, datasetRidArg rid.ResourceIdentifier, fileIdArg datasource.DatasetFileId, requestArg MarkFileIngestSuccessful) (DatasetFile, error)
	MarkFileIngestError(ctx context.Context, datasetRidArg rid.ResourceIdentifier, fileIdArg datasource.DatasetFileId, requestArg MarkFileIngestError) (DatasetFile, error)
	/*
	   Updates file-type-specific metadata for a dataset file. Currently used to update video segment metadata
	   after video segmentation is complete.
	*/
	UpdateDatasetFileMetadata(ctx context.Context, datasetRidArg rids.DatasetRid, fileIdArg datasource.DatasetFileId, metadataArg DatasetFileMetadata) (DatasetFile, error)
	UpdateDatasetMetadata(ctx context.Context, datasetRidArg rid.ResourceIdentifier, requestArg UpdateDatasetMetadata) (EnrichedDataset, error)
	UpdateBounds(ctx context.Context, ridArg rid.ResourceIdentifier, requestArg UpdateBoundsRequest) (EnrichedDataset, error)
	/*
	   Update the bounds for a dataset without updating bounds of files within the dataset. If the
	   current bounds of the dataset are not set, then the bounds of the request will be used. Otherwise,
	   the bounds will be min(current start, request start), max(current end, request end).
	*/
	UpdateGlobalDatasetBounds(ctx context.Context, ridArg rid.ResourceIdentifier, requestArg UpdateBoundsRequest) (Dataset, error)
	/*
	   Archives a dataset, which will hide it from search results unless the includeArchived flag is set to true. The
	   dataset can still be directly accessed by its UUID/rid.
	*/
	ArchiveDataset(ctx context.Context, datasetRidArg rid.ResourceIdentifier) error
	// Undoes the archiving of a dataset.
	UnarchiveDataset(ctx context.Context, datasetRidArg rid.ResourceIdentifier) error
	GetAllPropertiesAndLabels(ctx context.Context, workspacesArg []rids.WorkspaceRid) (AllPropertiesAndLabelsResponse, error)
	// Returns the log dataset RID for the specified workspace if configured and accessible to the caller.
	GetLogDatasetForWorkspace(ctx context.Context, workspaceRidArg rids.WorkspaceRid) (*rids.DatasetRid, error)
}

